1	My Cancer Genome	Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	My Cancer Genome outlines variants that drive tumorigenesis and/or that have therapeutic implications. My Cancer Genome is an expert curated resource, using disease experts (as Section, Contributing, and Consulting Editors) to produce summaries of genomic events that can enable genetically informed cancer medicine. The variants outlined in the resource are those that My Cancer Genome editors felt are most important to clinical care. The variants in My Cancer Genome are high quality and an excellent addition to DoCM. In our curation process we evaluated the referenced publications on all publically visible My Cancer Genome pages. Upon review of the publications that My Cancer Genome cites, the majority of variants appear to be pathogenic. Few variants are diagnostic or prognostic. My Cancer Genome also identifies relevant clinical trials for variants. The variants outlined in My Cancer Genome are well supported with a detailed write up outlining each variant’s role in a particular cancer type. Links to these pages were included in DoCM to allow for access to these summaries for additional information about these variants. A representative transcript was chosen such that the amino acid change would resemble the variant outlined in the paper. In the event that there were multiple transcripts that included this variant, the longest transcript was chosen. Variants without literature support were not included in DoCM.	mcg_new.tsv	94b8c859-ea01-4c5f-8aa4-0062cf975bd3-my-cancer-genome-ben	2016-06-07 14:47:34.32869	2016-06-07 14:47:34.32869	\N	Pathogenic	https://www.mycancergenome.org/about/what-is-my-cancer-genome/
2	WashU hematologic malignancy mutation list	Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	The WashU hematologic malignancy mutation list represents variants outlined for their importance in leukemias by investigators at Washington University that study hematologic malignancies. Many of these variants have established effects on tumor growth in leukemias with some having clinical trials performed. The variants were provided by domain experts in the genomics of hematologic malignancies and further curated against the biomedical literature. The transcript was chosen such that the amino acid change resembles the variant outlined in the cited paper. In the event that there were multiple transcripts that included this variant, the longest transcript was chosen.	tl.tsv	ef827f91-0960-48d0-aad4-e0d7da874201-washu-hematologic-malignancy	2016-06-07 15:37:37.761543	2016-06-07 15:37:37.761543	\N	Likely Pathogenic	
3	Literature	Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	This is a list of variants curated from the literature in the original release of DoCM. These variants were all included because they have and obvious functional or clinical evidence outlined in the accompanying publication. To be included these variants needed to outline how the variant was observed to be pathogenic in a particular disease in a model organism study or provide useful clinical information, like prognostic and diagnostic value based on the presence of this variant. Disease ontology ids and transcripts were chosen to most closely resemble the mutation described in the publication, in the event that multiple transcripts were possible, the longest transcript was chosen.	literature.tsv	fb1ae388-03e6-4e81-a625-a9f2a48647ce-literature-ben-ainscough	2016-06-07 16:58:20.868918	2016-06-07 16:58:20.868918	\N	Likely Pathogenic	
5	Drug Gene Knowledge Database	Jason Kunisaki, Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	The Drug Gene Knowledge Database by Dienstmann et al. [Cancer Discov; 5(2); 118-23] is an open resource that outlines the “prevalence of mutations and copy-number alterations with predictive associations across solid tumors.” This resource outlines the importance of individual variants in cancer along with a PubMed reference including the drugs that target a particular mutation. The variants outlined in this resource fit within the inclusion criteria for DoCM. Only variants with a PubMed reference were included in DoCM. Since this database is open, high quality and freely available, useful metadata, like drug sensitivity information, was included in DoCM. The transcript was chosen such that the amino acid change resembles the variant outlined in the paper. In the event that there were multiple transcripts that included this variant, the longest transcript was chosen.	dienstmann_new.tsv	e2a176ab-32fd-4ed1-b1cf-5956b88fecbc-drug-gene-knowledge-database	2016-06-07 17:58:15.821805	2016-06-07 17:58:15.821805	\N	Likely Pathogenic	http://cancerdiscovery.aacrjournals.org/content/5/2/118.full.pdf 
6	Oncomap Variants	Mayank Choudhary, Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	Oncomap is a listing of 471 variants with known and established importance in cancer, many of which are known to predict response or resistance to targeted therapies. The panel is used as a diagnostic test to identify tumorigenic mutations in clinical cases by MacConnaill et al. in their manuscript in the Journal of Molecular Diagnostics. Many of these mutations overlap with mutations already existing in DoCM and this panel adds further credibility to their importance. As only the gene and amino acid were listed in the publication, many fields were filled in by manual curation. The transcript was chosen such that the amino acid change resembles the variant outlined in the cited paper. In the event that there were multiple transcripts that included this variant, the longest transcript was chosen. Associated diseases and other relevant sources were identified by searching PubMed for the gene and amino acid change.	oncomap.tsv	3287cb21-9aaf-4315-a7f2-ba5c9c3bbfaf-oncomap-variants-mayank	2016-06-07 18:11:49.106951	2016-06-07 18:11:49.106951	\N	Likely Pathogenic	http://www.sciencedirect.com/science/article/pii/S1525157814001287
7	Pan-cancer recurrent hotspots	Ben Ainscough	bainscou@genome.wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	These variants were identified as recurrent hotspots in Chang et al.’s Nature Biotechnology publication in November 2015. They define a mutational hotspot as a variant that 1) occurs in a gene in which mutations can lead to a fitness advantage of a cancer cell, and 2) occurs in an amino acid position that is mutated more frequently than would be expected in the absence of selection. Since these variants are significantly mutated across different cancer types it is very likely that they are functional in cancer and are certainly are of significant interest to the cancer community. The authors further curated the variants into 3 levels: level 1 variants are those that were never before described as a recurrent hotspot mutation, level 2 variants are recurrent hotspots identified previously and were observed in multiple tumor types, and level 3 variants have been assessed functionally in vitro or in vivo in previous studies. Level 2 and 3 variants were included in DoCM as they had more robust support of having been observed in multiple tumor types and proven functional in prior study. Transcripts were selected that could recapitulate the described amino acid change; when multiple suitable transcripts were present the transcript with the highest predicted pathogenicity was chosen.	pancan_hotspot.tsv	7bb245fe-9092-4bb6-8fdb-f641fe7644d0-pan-cancer-recurrent	2016-06-07 18:18:08.042181	2016-06-07 18:18:08.042181	\N	Likely Pathogenic	http://cancerhotspots.org
8	Kin-Driver	Alex Wagner	awagner24@wustl.edu	McDonnell Genome Institute, Washington University School of Medicine	Kin-driver is the first database that compiles driver mutations in protein kinases (PKs) with experimental evidence demonstrating their functional role. This expert-curated database determines if a particular mutation has been described in the scientific literature as having activating or inactivating effects. This was achieved through the use of text-mining of PubMed articles for inactivating mutations in tumor-suppressor kinases and gain-of-function mutations in proto-oncogenic kinases, and these were limited to only those mutations with an experimentally demonstrated loss or gain of function. The database presents these variants in their amino acid context, along with an internal representation of associated disease(s) and references. We reviewed their results, selecting transcripts for import into DoCM based upon consistency with the reported amino acid change, the predicted pathogenicity of the mutation, and the existence of primary literature supporting the claim.	kindriver_batch1.tsv	6e82463b-be00-4268-add9-76a2bb4ec012-kin-driver-alex-wagner	2016-06-07 19:57:40.037754	2016-06-07 19:57:40.037754	\N		http://www.ncbi.nlm.nih.gov/pmc/articles/PMC4237945/
